import React from 'react';
import './DietPlans.css';

function DietPlans() {
  return (
    <div className="diet-plans">
      <h1>Diet Plans</h1>
      <div className="plan">
        <img src="recipe1.jpg" alt="Recipe 1" />
        <p>Recipe 1: Healthy Salad</p>
      </div>
      <div className="plan">
        <img src="recipe2.jpg" alt="Recipe 2" />
        <p>Recipe 2: Smoothie Bowl</p>
      </div>
    </div>
  );
}

export default DietPlans;
